import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importing Bootstrap CSS
import Header from './components/Header'; // Importing Header Component
import Menu from './components/Menu'; // Importing Menu Component
import OrderSection from './components/OrderSection'; // Importing OrderSection Component
import Footer from './components/Footer'; // Importing Footer Component

function App() {
  return (
    <div className="App">
      <Header /> {/* Rendering Header Component */}
      <Menu /> {/* Rendering Menu Component */}
      <OrderSection /> {/* Rendering OrderSection Component */}
      <Footer /> {/* Rendering Footer Component */}
    </div>
  );
}

export default App;
